import React from 'react';

const ProductTile = ({ product }) => {
  return (
    <div>
      <img src={`/images/${product.images[0]}`} alt={product.name} />
      <div >
        <div className="text-3xl font-bold underline">{product.name}</div>
        <p>${product.price}</p>
      </div>
    </div>
  );
};

export default ProductTile;
